import styled from 'styled-components'

const NavBar = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 100%;
  background-color: #fff;

  .greeting{
    margin: 0;
    font-size: 35px;
    font-weight: 700;
  }

  .amount {
    width: 50px;
    height: 50px;
    font-size: 30px;
    font-weight: 600;
    text-align: center;
    border-radius: 50%;
    background-color: rgba(2, 2, 74, 0.94);
    color: #fff;

  }
`
export function Nav() {
  return (
    <>
      <NavBar>
        <span className='greeting'> Have a GOOD day! </span>
        <div className='amount'>3</div>
      </NavBar>
    </>
  )
}
